import React, { Component } from 'react';


//props: 
// displayData: {name, region, season}


class Display extends Component {
    state = {  } 
    render() { 
        return (
            /** of class flex-container-display */
            <React.Fragment>

                <div class="flex-item-display flex-display-header">
                    <div class="header-title">{this.props.displayData.name}</div>
                    <div class="header-region">
                        {this.props.displayData.region}
                    <p class="season-data">Season: { this.props.displayData.season }</p>
                    </div>
                </div>

                <div class="flex-item-display-data flex-container-data">
                    <div class="flex-item-data season">

                       <div class="season-img"></div>


                    </div>
                </div>
            </React.Fragment>

        );
    }
}

export default Display;
